import Content from "./content";
import ContMess from "./contMess";
import "./conversationScreen.css";

function Messages() {
  return (
    <div className="all">
          <div className="messagesWrapper">
      <Content />
      <ContMess />
      <ContMess mine={true} />
      <ContMess />
      <ContMess mine={true} />
      <ContMess />
      <ContMess mine={true} />
      <ContMess />
      <ContMess mine={true} />
      <ContMess />
      <ContMess mine={true} />
      <ContMess />
      <ContMess mine={true} />
    </div>
    <input type="text" className="writeMess" />
    </div>
  );
}
export default Messages;
